import { gql } from '@apollo/client';  
  
const Fetch_CURRENCY_QUERY = this.props.client.query({
    query: gql`
    {
      currencies {
        label
        symbol
      }
      }
    `
  })
  


export default {Fetch_CURRENCY_QUERY};
